import React from 'react'
import useStyles from './styles';
import lucir from '../../assets/lucir.png';
import { Link, useLocation } from 'react-router-dom';
import { Typography } from '@material-ui/core';
import VideoBackground from '../VideoBackground/VideoBackground';
import { Button } from '@material-ui/core';
import './HeroSection.css';
import video from '../../assets/waves.mp4'


const Home = () => {
    const classes = useStyles();
    const image = lucir;

    return (
        <div>
            <div className='hero-container'>   
                <video src={video} autoPlay loop muted />
                <span id="welcomeTo">Presenting </span><img id="lucir" src={image} alt="Link to store" />
                <p id="intro">You have found the cleanest soap store on the internet. We pledge minimal processing, with maximum quality. To do this, we choose less processed ingredients, and hand-make every batch of soap. We aim to reduce energy waste in this world. This fragile pale blue dot we call home must be diligently protected -- for a clean body, mind, soul, and Earth.</p>
                <Button component={Link} to="/shop" className='btn' variant="contained" color='mintgreen' style={{ marginTop: '100px', maxWidth: '130px', maxHeight: '60px', minWidth: '130px', minHeight: '50px' }} >
                    See Products
                </Button>
            </div>

        </div>
    )
}

export default Home
